import React from "react";
import { TPTable1, TPContainer, TPtd, TPLinks, TPTitleText } from "./styles";
import { AiOutlineTool } from "react-icons/ai";

const ToolsPage = () => {
  return (
    <TPContainer>
      <TPTitleText>
        <AiOutlineTool />
        {"\u00A0 "} Tools
      </TPTitleText>
      <TPTable1>
        <tr>
          <TPtd>
            <TPLinks
              href={"https://mail.google.com/mail/u/1/#inbox"}
              target="_blank"
            >
              <AiOutlineTool /> {"\u00A0 "}Tinywow
            </TPLinks>
            <TPLinks
              href={"https://mail.google.com/mail/u/1/#inbox"}
              target="_blank"
            >
              <AiOutlineTool /> {"\u00A0 "}Color generator
            </TPLinks>
          </TPtd>
          <TPtd>
            <TPLinks
              href={"https://mail.google.com/mail/u/1/#inbox"}
              target="_blank"
            >
              <AiOutlineTool /> {"\u00A0 "}Tutoriais W3
            </TPLinks>
            <TPLinks
              href={"https://mail.google.com/mail/u/1/#inbox"}
              target="_blank"
            >
              <AiOutlineTool /> {"\u00A0 "}Color generator
            </TPLinks>
          </TPtd>
        </tr>
      </TPTable1>
    </TPContainer>
  );
};

export default ToolsPage;
